import React from "react"

function Header() {
    return (
        <div id="headerBar">
        <img id="teamLogo" src="https://www.logoground.com/uploads/2017106372017-04-083655947Rhino.jpg" alt="rhino logo"></img>
        <h2>Brooklyn Rhinos</h2>
        <h2>8-1</h2>
        </div>
    )
}

export default Header
